import React, { useEffect } from 'react';
import network from '../utils/network';

const HomePage = () => {
  useEffect(() => {
    network.getSeaData();
  }, []);

  return <div>Welcome to Next.js!</div>
}

export const getStaticProps = async () => {
  const res = await network.getSeaData();

  console.log(res);

  return {
    props: {
      res,
    }
  }

}

export default HomePage
